using Plugin.Geolocator;
using postcodesorter.webservices;
using System;
using System.Collections.Generic;
using System.Threading.Tasks;
using Xamarin.Forms;

namespace postcodesorter
{
    public class DataListView : ContentPage
    {
        List<string> postcodes;

        public double Longitude { get; set; }
        public double Latititude { get; set; }

        public DataListView()
        {
            PopulatePostcodes();
            var postcode = GetMyPostcode();
            CreateSortedList(postcode).ConfigureAwait(true);
        }
        
        async Task CreateSortedList(string postcode)
        {
            var listView = new ListView
            {
                ItemTemplate = new DataTemplate(typeof(ListViewCell)),
                HasUnevenRows = true
            };
            await Webservice.SortPostcodeByDistance(postcode, postcodes).ContinueWith((t) =>
            {
                if (t.IsCompleted)
                {
                    Device.BeginInvokeOnMainThread(() => listView.ItemsSource = t.Result);
                }
            });
            Content = listView;
            
        }

        string GetMyPostcode()
        {
            var locator = CrossGeolocator.Current;
            locator.DesiredAccuracy = 100; //100 is new default 
            var postcode = string.Empty; 
            locator.GetPositionAsync(timeoutMilliseconds: 10000).ContinueWith((t) =>
            {
                if (t.IsCompleted)
                {
                    try
                    {
                        Longitude = t.Result.Longitude;
                        Latititude = t.Result.Latitude;
                        postcode = Webservice.GetPostcode(Longitude, Latititude).Result;
                    }
                    catch (AggregateException)
                    {
                        Longitude = 0.110487;
                        Latititude = 51.577993;
                        postcode = "IG38XJ";
                    }
                }
                if (t.IsFaulted || t.IsCanceled)
                {
                    Longitude = 0.110487;
                    Latititude = 51.577993;
                    postcode = "IG38XJ";
                }
            }).ConfigureAwait(true);
            while (string.IsNullOrEmpty(postcode))
            { }
            return postcode;
        }

